import React from 'react';
import ReactDOM, { render } from 'react-dom';
import App from './components/App';
import "../src/Css/App.css";

ReactDOM.render (
    <Router>
        <Router>
            <Route path="/" element={<App/>} />
        </Router>
    </Router>,
document.getElementById('root')

);
